import React from "react";

const HomeCard = () =>{
    return(
        <section className="HomeCard">
            <div className="container">
                <div className="row">
                    <div className="col-lg-4">
                        <div className="card">
                            <div className="upper_layer">
                                <img src="" alt="" />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>

    )
}

export default HomeCard;
